import { useNavigate } from 'react-router-dom';
import './Landing.scss';
import { SingleActionButton } from '../../components/Button/SingleActionButton';

export const Landing = () => {
  const navigate = useNavigate();
  const routeToSignUp = {
    handler() {
      navigate('SignUp');
    },
    title: 'Sign Up',
  };

  const routeToSignIn = {
    handler() {
      navigate('SignIn');
    },
    title: 'Sign In',
  };

  const routeToRoulette = {
    handler() {
      navigate('Roulette');
    },
    title: 'Try it!',
  };
  return (
    <div className="landing-page">
      <div className="img-placeholder" data-testid="landing-image"></div>
      <h1 className="logo-placeholder">Bootcamper</h1>
      <SingleActionButton payload={routeToSignUp} type="long" />
      <SingleActionButton payload={routeToSignIn} style="light" type="long" />
      <h3>Want to take a test drive first?</h3>
      <SingleActionButton payload={routeToRoulette} />
      <p> Help | Contact</p>
    </div>
  );
};
